(10, 'Tài Khoản Netflix Premium', 'tai-khoan-netflix-premium-pAig2', 'dfgh', 'ghjfghbj', '0000-00-00', 52, 'Premium', '350000', 'fixed', '<div>???? Xem phim trên NetFlix ở mọi thiết bị : Smart Tivi , Máy Tính , Laptop , Điện Thoại</div><div>✅ Chất lượng hình ảnh Ultra Full HD 4K</div><div>✅ Có hàng nghìn bộ phim đang rất HOT chỉ có trên NF</div><div>✅ Phim dịch Vietsub tiếng việt chuẩn nhất</div><div>✅ Không có quảng cáo chen ngang khi xem phim</div><div>✅ Chất lượng đường truyền luôn ổn định</div><div>✅ Xem Offline mà không cần internet</div>', 'featured', 'show', 0, 'instock', 1, '2021-10-17 23:45:31'),
(11, 'Tài khoản K+ hạn {date_expired}', 'tai-khoan-k-han-dateexpired-2eUyI', '0326648390', '1234567890', '2022-03-19', 51, 'Premium+', '15000', 'change', '<div>- Tại Đây Bán Tài Khoản K+ PREMIUM Giá Rẻ</div><div>- Xem K+ trực tuyến bất cứ nơi nào bạn muốn bằng máy tính bàn, máy tính xách tay, điện thoại, máy tính bảng, Android TV</div><div>- Độc quyền chỉ có trên K+: Ngoại Hạng Anh, LaLiga, Tennis ATP,...</div><div>- Xem đến 120 kênh trong nước và quốc tế bao gồm 4 kênh K+ cùng nhiều kênh đặc sắc như: HBO, FOX Sports, FOX Sports 2, FOX Movies, FOX Life, Cartoon Network, HITS, Discovery, National Geographic, AFC...</div><div>- Kho VOD: Thưởng thức hàng ngàn giờ phim và thể thao chọn lọc nhất trên các kênh K+ được phân loại theo các nhóm nội dung đặc sắc.</div><div>- Nhiều tính năng và rất thuận tiện: Kết nối thiết bị di động để xem qua màn hình TV, Xem lại nội dung đã phát sóng, xem trước Lịch phát sóng,...</div><div><div>=>【KM siêu khủng】Xem K.+Chỉ với 50k/1 tháng. Anh em có thể xem tất cả các giải Ngoại Hạng Anh, Laliga 1, Europa League...</div><div>- Càng mua nhiều tháng giá càng mềm</div><div>- Tài khoản có thể xem trên Điện Thoại , Máy Tính , Android TV Box với chất lượng hình ảnh và nội dung đặc sắc. </div><div>- Tài khoản chính chủ, an toàn, nhanh gọn, chuyên nghiệp, hỗ trợ 24/7</div><div>- Gói xem được K+1, K+PM, K+NS, K+PC và hơn 110 kênh truyền hình khác thuộc gói kênh Premium+</div><div>- Uy tín chất lượng cam kết bảo hành 1 đổi 1 trong quá trình sử dụng nếu có lỗi</div><div><span style=\"font-family: Poppins, Helvetica, sans-serif;\">➖➖➖➖➖➖➖➖</span></div><div>Gói 1-12 tháng</div><div><br></div><div><u>Ghi chú: Đây là tài khoản đi kèm với đầu thu chảo, khách hàng không có nhu cầu xem online nên bán lại với giá rẻ.</u></div></div>', 'featured', 'show', 0, 'instock', 1, '2021-10-18 22:58:37'),
