5px; padding: 0px; display: block; width: 8px; height: 8px; border-radius: 20px; background: none; border: 1px solid rgb(191, 191, 191);\"></span></div></div><div class=\"owl-buttons\" style=\"margin: 0px; padding: 0px; opacity: 0;\"><div class=\"owl-prev\" style=\"margin: 0px 0px 0px 5px; padding: 0px; cursor: pointer; display: inline-block; zoom: 1; float: left; background: url(\"https://cdn.thegioididong.com/v2015/Content/desktop/images/V4/icondesktop@1x.png\") -130px -50px no-repeat; width: 22px; height: 40px; position: absolute; top: 205.188px; left: 0px;\"></div><div class=\"owl-next\" style=\"margin: 0px 5px 0px 0px; padding: 0px; cursor: pointer; display: inline-block; zoom: 1; float: right; background: url(\"https://cdn.thegioididong.com/v2015/Content/desktop/images/V4/icondesktop@1x.png\") -155px -50px no-repeat; width: 22px; height: 40px; position: absolute; top: 205.188px; right: 0px;\"></div></div></div></div></div><div class=\"boxArticle\" style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Helvetica, Arial, \"DejaVu Sans\", \"Liberation Sans\", Freesans, sans-serif;\"><article class=\"area_article  area_articleFull\" style=\"margin: 15px 0px 0px; padding: 0px; font-size: 16px; line-height: 1.5; max-width: 750px; overflow: visible;\"><h2 style=\"margin-right: 0px; margin-bottom: 10px; margin-left: 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 1.3em; outline: none; zoom: 1; overflow: hidden;\"><font color=\"#50a8e3\"><span style=\"font-stretch: normal; line-height: 18px;\">iPhone X 64 GB</span></font> là cụm từ được rất nhiều người mong chờ muốn biết và tìm kiếm trên Google bởi đây là chiếc điện thoại mà Apple kỉ niệm 10 năm <font color=\"#50a8e3\"><span style=\"font-stretch: normal; line-height: 18px;\">iPhone</span></font> đầu tiên được bán ra.</h2><h3 style=\"margin: 30px 0px 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 1.3em; outline: none; zoom: 1; overflow: hidden;\">Thiết kế mang tính đột phá</h3><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Như các bạn cũng đã biết thì đã 4 năm kể từ chiếc <font color=\"#50a8e3\">điện thoại</font> iPhone 6 và iPhone 6 Plus thì Apple vẫn chưa có thay đổi nào đáng kể trong thiết kế của mình.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/114115/iphone-x-64gb1.jpg\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\"><img alt=\"Thiết kế đột phá của điện thoại iPhone X\" data-original=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb1.jpg\" class=\"lazy\" title=\"Thiết kế đột phá của điện thoại iPhone X\" src=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb1.jpg\" style=\"margin: 10px auto; padding: 0px; border: 0px; display: block; max-width: 100%; height: auto; max-height: 584px;\"></a></p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Nhưng với iPhone X thì đó lại là 1 câu chuyện hoàn toàn khác, máy chuyển qua sử dụng màn hình tỉ lệ 19.5:9 mới mẻ với phần diện tích hiển thị mặt trước cực lớn.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/114115/iphone-x-64gb2.jpg\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\"><img alt=\"Thiết kế đột phá của điện thoại iPhone X\" data-original=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb2.jpg\" class=\"lazy\" title=\"Thiết kế đột phá của điện thoại iPhone X\" src=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb2.jpg\" style=\"margin: 10px auto; padding: 0px; border: 0px; display: block; max-width: 100%; height: auto; max-height: 584px;\"></a></p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Mặt lưng kính hỗ trợ sạc nhanh không dây cũng như phần camera kép đặt dọc cũng là những thứ đầu tiên xuất hiện trên 1 chiếc iPhone.</p><h3 style=\"margin: 30px 0px 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 1.3em; outline: none; zoom: 1; overflow: hidden;\">Màn hình với tai thỏ</h3><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Điểm khiến iPhone X bị chê nhiều nhất đó chính là phần \"tai thỏ\" phía trên màn hình, Apple đã chấp nhận điều này để đặt cụm camera TrueDepth mới của hãng.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/114115/iphone-x-64gb15.jpg\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\"><img alt=\"Màn hình tai thỏ của điện thoại iPhone X\" data-original=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb15.jpg\" class=\"lazy\" title=\"Màn hình tai thỏ của điện thoại iPhone X\" src=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb15.jpg\" style=\"margin: 10px auto; padding: 0px; border: 0px; display: block; max-width: 100%; height: auto; max-height: 584px;\"></a></p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Màn hình kích thước 5.8 inch độ phân giải 1125 x 2436 pixels đem đến khả năng hiển thị xuất sắc.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/114115/iphone-x-64gb20.jpg\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\"><img alt=\"Màn hình tai thỏ của điện thoại iPhone X\" data-original=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb20.jpg\" class=\"lazy\" title=\"Màn hình tai thỏ của điện thoại iPhone X\" src=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb20.jpg\" style=\"margin: 10px auto; padding: 0px; border: 0px; display: block; max-width: 100%; height: auto; max-height: 584px;\"></a></p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">iPhone X sử dụng tấm nền <a href=\"https://www.thegioididong.com/hoi-dap/man-hinh-oled-la-gi-905762\" target=\"_blank\" title=\"Tìm hiểu màn hình OLED\" type=\"Tìm hiểu màn hình OLED\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\">OLED</a> (được tinh chỉnh bởi Apple) thay vì LCD như những chiếc iPhone trước đây và điều này đem lại cho máy 1 màu đen thể hiện rất sâu cùng khả năng tái tạo màu sắc không kém phần chính xác.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Xem thêm: <a href=\"https://www.thegioididong.com/tin-tuc/trai-nghiem-giao-dien-iphone-x-1041322\" target=\"_blank\" title=\"Trải nghiệm giao diện iPhone X\" type=\"Trải nghiệm giao diện iPhone X\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\">Trải nghiệm giao diện iPhone X: Xem phim, chơi game có sướng?</a></p><h3 style=\"margin: 30px 0px 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 1.3em; outline: none; zoom: 1; overflow: hidden;\">Face ID tạo nên đột phá</h3><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Touch ID trên iPhone X đã bị loại bỏ, thay vào đó là bạn sẽ chuyển qua sử dụng Face ID, một phương thức bảo mật sinh trắc học mới của Apple.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/114115/iphone-x-64gb7.jpg\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\"><img alt=\"Face ID tạo nên đột phá trên điện thoại iPhone X\" data-original=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb7.jpg\" class=\"lazy\" title=\"Face ID tạo nên đột phá trên điện thoại iPhone X\" src=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb7.jpg\" style=\"margin: 10px auto; padding: 0px; border: 0px; display: block; max-width: 100%; height: auto; max-height: 584px;\"></a></p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Với sự trợ giúp của cụm camera TrueDept thì iPhone X có khả năng nhận diện khuôn mặt 3D của người dùng từ đó mở khóa chiếc iPhone một cách nhanh chóng.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/114115/iphone-x-64gb11.jpg\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\"><img alt=\"Face ID tạo nên đột phá trên điện thoại iPhone X\" data-original=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb11.jpg\" class=\"lazy\" title=\"Face ID tạo nên đột phá trên điện thoại iPhone X\" src=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb11.jpg\" style=\"margin: 10px auto; padding: 0px; border: 0px; display: block; max-width: 100%; height: auto; max-height: 584px;\"></a></p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Tuy sẽ hơi hụt hẫng khi Touch ID đã quá quen thuộc trên những chiếc iPhone như tốc độ cũng như trải nghiệm \"khóa như không khóa\" của Face ID hoàn toàn có thể khiến bạn yên tâm sử dụng.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/114115/iphone-x-64gb10.jpg\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\"><img alt=\"Điện thoại iPhone X tích hợp Face ID\" data-original=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb10.jpg\" class=\"lazy\" title=\"Điện thoại iPhone X tích hợp Face ID\" src=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb10.jpg\" style=\"margin: 10px auto; padding: 0px; border: 0px; display: block; max-width: 100%; height: auto; max-height: 584px;\"></a></p><h3 style=\"margin: 30px 0px 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 1.3em; outline: none; zoom: 1; overflow: hidden;\">Thao tác vuốt và vuốt</h3><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Không còn phím Home cứng nên các thao tác trên iPhone X cũng hoàn toàn khác so với những đàn anh đi trước.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/114115/iphone-x-64gb3.jpg\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\"><img alt=\"Thao tác vuốt và vuốt trên điện thoại iPhone X\" data-original=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb3.jpg\" class=\"lazy\" title=\"Thao tác vuốt và vuốt trên điện thoại iPhone X\" src=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb3.jpg\" style=\"margin: 10px auto; padding: 0px; border: 0px; display: block; max-width: 100%; height: auto; max-height: 584px;\"></a></p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Giờ đây chỉ với thao tác vuốt và vuốt từ cạnh dưới là bạn đã có thể truy cập vào đa nhiệm, trở về màn hình Home một cách nhanh chóng.</p><h3 style=\"margin: 30px 0px 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 1.3em; outline: none; zoom: 1; overflow: hidden;\">Camera kép cải tiến tích hợp Animoji</h3><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">iPhone X vẫn sở hữu bộ đôi camera kép có cùng độ phân giải 12 MP nhưng camera tele thứ 2 với khẩu độ được nâng lên mức f/2.4 so với f/2.8 của iPhone 7 Plus.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/114115/iphone-x-64gb-12-5.jpg\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\"><img alt=\"Điện thoại iPhone X tích hợp camera kép\" data-original=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb-12-5.jpg\" class=\"lazy\" title=\"Điện thoại iPhone X tích hợp camera kép\" src=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb-12-5.jpg\" style=\"margin: 10px auto; padding: 0px; border: 0px; display: block; max-width: 100%; height: auto; max-height: 584px;\"></a></p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Ngoài ra thì cả 2 camera trên iPhone X đều sở hữu cho mình khả năng chống rung quang học giúp bạn dễ dàng bắt trọn mọi khoảnh khắc trong cuộc sống.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/114115/iphone-x-64gb-14-4.jpg\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\"><img alt=\"Ảnh chụp từ camera kép trên iPhone X\" data-original=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb-14-4.jpg\" class=\"lazy\" title=\"Ảnh chụp từ camera kép trên iPhone X\" src=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb-14-4.jpg\" style=\"margin: 10px auto; padding: 0px; border: 0px; display: block; max-width: 100%; height: auto; max-height: 584px;\"></a></p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Camera trước độ phân giải 7 MP với khả năng selfie xóa phông đáp ứng tốt mọi nhu cầu tự sướng của giới trẻ hiện nay.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/114115/iphone-x-64gb-13-5.jpg\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\"><img alt=\"Ảnh selfie trên iPhone X\" data-original=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb-13-5.jpg\" class=\"lazy\" title=\"Ảnh selfie trên iPhone X\" src=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb-13-5.jpg\" style=\"margin: 10px auto; padding: 0px; border: 0px; display: block; max-width: 100%; height: auto; max-height: 584px;\"></a></p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Bộ đôi camera trên iPhone X được đánh giá rất cao về chất lượng ảnh chụp và là một trong những chiếc camera phone chụp ảnh đẹp nhất trong năm 2017.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Xem thêm: <font color=\"#50a8e3\">Đánh giá chi tiết iPhone X: \"Khải huyền\" của Apple sau 10 năm</font></p><h3 style=\"margin: 30px 0px 0px; padding: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 20px; line-height: 1.3em; outline: none; zoom: 1; overflow: hidden;\">Hiệu năng mạnh mẽ với Apple A11</h3><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Hiệu năng của những chiếc iPhone chưa bao giờ là vấn đề và với iPhone X thì mọi thứ vẫn rất ấn tượng.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Con chip <font color=\"#50a8e3\">Apple A11 Bionic 6 nhân</font> kết hợp với 3 GB RAM thì iPhone X tự tin là chiếc smartphone mạnh mẽ nhất mà Apple từng sản xuất.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/114115/iphone-x-64gb-1-11.jpg\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\"><img alt=\"Điểm Antutu Benchmark trên iPhone X\" data-original=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb-1-11.jpg\" class=\"lazy\" title=\"Điểm Antutu Benchmark trên iPhone X\" src=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb-1-11.jpg\" style=\"margin: 10px auto; padding: 0px; border: 0px; display: block; max-width: 100%; height: auto; max-height: 584px;\"></a></p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Ngoài ra với iPhone X thì Apple cũng nhấn mạnh với trải nghiệm thực tế ảo tăng cường giúp bạn có những phút giây thư giãn thú vị.</p><p style=\"margin-top: 10px; margin-right: 0px; margin-left: 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\"><a class=\"preventdefault\" href=\"https://www.thegioididong.com/images/42/114115/iphone-x-64gb-8-13.jpg\" style=\"margin: 0px; padding: 0px; color: rgb(80, 168, 227);\"><img alt=\"Cổng sạc lightning và loa chính trên iPhone X\" data-original=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb-8-13.jpg\" class=\"lazy\" title=\"Cổng sạc lightning và loa chính trên iPhone X\" src=\"https://cdn.tgdd.vn/Products/Images/42/114115/iphone-x-64gb-8-13.jpg\" style=\"margin: 10px auto; padding: 0px; border: 0px; display: block; max-width: 100%; height: auto; max-height: 584px;\"></a></p><p style=\"margin: 10px 0px; padding: 0px; margin-block-start: 0px; margin-block-end: 0px; text-rendering: geometricprecision;\">Viên pin trên iPhone X có dung lượng 2716 mAh (lớn hơn cả trên <font color=\"#50a8e3\">iPhone 8 Plus</font>) cho bạn sử dụng khá ổn trong khoảng một ngày liên tục.</p></article></div>', 'iphone,Iphonex,Apple', 27, 'content/uploads/product/K6iReUlxtCaWEZ_.png', 28, 14990000, 13500000, 10, 13000000, 'true', 0, 1, '', 'public', 'instock', 1, '2020-08-27 15:29:50', '2020-12-23 16:34:15');
